def shift(old, val, new = []):
    """Shifts the entire list val times to the left
    e.g. if val=1,
    [1,2,3] -> [2,3,1]
    
    if val=2
    [1,2,3,4,5] -> [3,4,5,1,2]
    """

    # appends everything to the right of val
    for i in range(val, len(old)):
        new.append(old[i])
    
    # appends everything from the first element to val
    for i in range(val):
        new.append(old[i])
    
    return new

